  return Promise.all([uploadPhoto(), createUser()])
    .then(() => {
      const { body } = body;
      const { firstName } = response[1];
      const { lastName } = response[1];
      console.log(`${body} ${firstName} ${lastName}`);
    })
    .catch(() => console.log('Signup system offline'));
}

